import * as React from 'react';
import {Avatar, Button, CssBaseline, TextField, FormControlLabel, Typography, Container, Checkbox, Link, Grid, Box} from '@mui/material';
import HowToRegIcon from '@mui/icons-material/HowToReg';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useNavigation } from '@react-navigation/native';
import { TouchableOpacity, Text , Modal, View} from 'react-native';
import { useState } from 'react';
import axios from 'axios';


const defaultTheme = createTheme();

export default function SignUp() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [registrationStatus, setRegistrationStatus] = useState(null);

  const handleSignUp = () => {
    axios
      .post('http://localhost:3000/sportSync/register', {
        firstName,
        lastName,
        email,
        password,
      })
      .then((response) => {
        console.log(response.data.message);
        if (response.data.message === 'passed') {
          // Registration successful, navigate to a different screen
          setRegistrationStatus('success');
          setTimeout(() => {
            setRegistrationStatus(null);
            navigation.navigate('SignIn' as never); // Will navigate to the SignIn page after 2 second if registration is succesful
          }, 1500); // 1500 milliseconds (1.5 seconds)

        } else {
          // Registration failed, show an error message
          setRegistrationStatus('failure');
          console.log('Registration failed');
          setTimeout(() => {
            setRegistrationStatus(null);
          }, 1500); // 1500 milliseconds (1.5 seconds)
        }
      })
      .catch((error) => {
        // Handle any errors

        console.error('Error:', error);
        setRegistrationStatus('failure');
        setTimeout(() => {
          setRegistrationStatus(null);
        }, 1500); // 1500 milliseconds (2 seconds)
      });
  };
  const navigation = useNavigation();

    const handleAlreadySignedUp = () => {
      navigation.navigate('SignIn' as never);
    };
  const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
      firstName: data.get('firstName'),
      lastName: data.get('lastName')
    });
  };

  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <HowToRegIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="firstName"
                  required
                  fullWidth
                  id="firstName"
                  label="First Name"
                  onChange={(event) => setFirstName(event.target.value)}
                  autoFocus
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  required
                  fullWidth
                  id="lastName"
                  label="Last Name"
                  name="lastName"
                  onChange={(event) => setLastName(event.target.value)}
                  autoComplete="family-name"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  onChange={(event) => setEmail(event.target.value)}
                  autoComplete="email"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Enter Password"
                  type="password"
                  id="password"
                  onChange={(event) => setPassword(event.target.value)}
                  autoComplete="new-password"
                />
              </Grid>
              <Grid item xs={12}>
                <FormControlLabel
                  control={<Checkbox value="allowExtraEmails" color="primary" />}
                  label="I want to receive inspiration, marketing promotions and updates via email."
                />
              </Grid>
            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              onClick={handleSignUp}
            >
              Sign Up
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
              <TouchableOpacity onPress={handleAlreadySignedUp}>
                <Link variant='body2'>
                  {"Already have an account? Sign In"}
                </Link>
              </TouchableOpacity>
              </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
      <Modal
        transparent={true}
        visible={registrationStatus !== null}
        animationType="slide"
      >
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', marginTop: 150 }}>
          <Text style={{ backgroundColor: 'white', padding: 20, textAlign: 'center' }}>
          {registrationStatus === 'success'
              ? 'Registration successful.'
              : 'Registration failed. Please try again.'}

          </Text>

        </View>
      </Modal>
    </ThemeProvider>
  );
}
